<div id="serie_info">Naruto Uzumaki è un ninja dodicenne del Villaggio della Foglia con il sogno di diventare Hokage, il ninja più importante del villaggio. Naruto ha passato l'infanzia nell'emarginazione e, durante uno scontro con Mizuki, un traditore, viene a scoprirne il motivo: dentro di lui è sigillata la Volpe, il più forte dei nove cercoteri. Dopo avere sconfitto Mizuki, Naruto viene promosso a Genin all'accademia ninja e viene integrato nel Team 7 composto, oltre a lui, da Kakashi Hatake, Sasuke Uchiha e Sakura Haruno. Dopo varie avventure, Sasuke abbandona il villaggio per allenarsi con Orochimaru ed ottenere il potere necessario per uccidere suo fratello Itachi che aveva precedentemente sterminato il suo clan e verso cui bramava da tempo vendetta. Con la fuga di Sasuke si conclude la prima serie animata.</div>

